/*!50003 CREATE*/ /*!50020 DEFINER=`root`@`localhost`*/ /*!50003 PROCEDURE `NoPresenceDetectedByParticipantIDAndDateRange`(IN participantID INT, IN startDate DATETIME, IN endDate DATETIME)
BEGIN
	set @average := 0;
  set @stddev := 0;
  
  
  
  SELECT AVG(temperatureSensorValue) INTO @average
  FROM sensordata
  WHERE motionSensorValue = 'false'
    AND fkParticipantID = participantID;
  
  
  
  SELECT STD(temperatureSensorValue) INTO @stddev
  FROM sensordata
  WHERE motionSensorValue = 'false'
    AND fkParticipantID = participantID;
  
  
  SELECT id, observationTime
  FROM sensordata
  WHERE fkParticipantID = participantID 
    AND observationTime BETWEEN startDate AND endDate
    AND (temperatureSensorValue > @average-(@stddev*1) AND temperatureSensorValue < @average+(@stddev*1));

  SELECT @average;
  select @stddev;

END */;;
